import React from "react";
import {
  signInWithGooglePopup,
  creatUserDocumentFromAuth,
} from "../../utils/firebase";

import SingUpForm from "../../components/Sing-Up-Form/SingUpForm";
import SingInForm from "../../components/Sing-in-Form/SingInForm";

const Authentication = () => {
  const logGoogleUser = async () => {
    const { user } = await signInWithGooglePopup();
    const userRefDoc = await creatUserDocumentFromAuth(user);
  };
  return (
    <div>
      <h1>SingIn</h1>
      <button onClick={logGoogleUser}>Snig in whit google</button>
      <SingUpForm />
      <SingInForm />
    </div>
  );
};

export default Authentication;
